Après avoir réalisé de bonnes prestations avec les différents [[Équipe du Japon féminine de football des moins de 20 ans|groupes jeunes]] de la sélection japonaise, notamment lors de la [[Coupe du monde féminine de football des moins de 20 ans 2008|Coupe du monde U-20]] de [[2008 en football|2008]], Saki Kumagai est recrutée par les [[Urawa Red Diamonds Ladies|Urawa Red Diamonds]] en début d'année [[2009]]. Elle joue son premier match en tant que joueuse professionnelle le {{date-|11|avril|2009}} contre l'[[Albirex Niigata Ladies|Albirex Niigata]] pour le compte de la {{1re|journée}} de [[Championnat du Japon de football féminin|championnat]] dans lequel évolue huit clubs qui s’affronteront trois fois chacun. En parallèle de sa jeune carrière de footballeuse professionnelle, Saki Kumagai entame des études supérieures à la Faculté de sciences de la santé et d'éducation physique de l'[[Université de Tsukuba]]<ref name=":2" />{{,}}<ref>{{Lien web|langue=Japonais|titre=Au cœur de la défense|url=http://www.asahi.com/sports/spo/asian_games2010/jinbutsu/TKY201011080190.html|site=asahi.com|date=9 novembre 2010}}.</ref>. Elle marque le premier but de sa carrière contre le club [[JEF United Ichihara Chiba Ladies|JEF United Chiba]] à la dernière journée de championnat le {{date-|1|novembre|2009}} ; elle inscrit un doublé au cours de ce même match, à la {{6e}} et {{71e|minute}}. Elle dispute la totalité des rencontres de son équipe et parvient à remporter le [[Championnat du Japon de football féminin|championnat du Japon]] dès sa première saison.

[[Fichier:Komabastadium1.JPG|thumb|alt=Stade Komaba|Komaba Stadium de [[Saitama]] dans lequel évolue la section.|gauche|220x220px]]
La [[Coupe du Japon féminine de football|Coupe du Japon]] est une compétition qui a la particularité de se dérouler en fin d'année, clôturant ainsi la saison de football se déroulant sur l'année civile. La finale se joue traditionnellement le {{date-|1|janvier}} au [[Stade olympique national (1958)|stade national olympique de Tokyo]]. Les joueuses de [[Saitama]] entament aisément leur parcours le {{date-|20|décembre}} au troisième tour contre le lycée O-hara Gakuen grâce à une victoire {{Abréviation discrète|4-0|Quatre buts à zéro}}. En quarts de finale le {{date-|23|décembre}}, elles rencontrent plus de difficultés contre le [[JEF United Ichihara Chiba Ladies|club de Chiba]] mais s'imposent tout de même {{Abréviation discrète|2-0|Deux buts à zéro}} ; Saki Kumagai assure même la victoire en inscrivant un but à la {{77e|minute}}. En demi-finale le {{date-|28|décembre}}, elles affrontent l'[[INAC Kobe Leonessa|INAC Kobe]] et remportent le match {{Abréviation discrète|3-2|Trois buts à deux}}. En finale le {{date-|1|janvier}}, elles sont opposées au redoutable club [[tokyo]]ïte du [[NTV Beleza]] ; elles sont malheureusement défaites {{Abréviation discrète|2-0|Deux buts à zéro}}. Une fin de saison amère pour les joueuses puisqu'elles échouent dans leur tentative de réaliser un premier doublé national historique mais gardent la satisfaction d'avoir offert le deuxième titre de champion à la [[Urawa Red Diamonds Ladies|section féminine]] des [[Urawa Red Diamonds]]. À l'issue de la [[2009 en football|saison 2009]], Saki Kumagai obtient donc son premier trophée et marque {{nombre|3|buts}} toutes compétitions confondues.
{{Boîte déroulante/début|titre=Résultats de Saki Kumagai sur la saison|alignB=centre|align=justify|alignT=right|largeur=70%|couleurFondT=transparent|couleurFondB=transparent|arrondi=0.6em}}

{{Boîte déroulante/fin}}

Le début de saison [[2010 en football|2010]] est marqué par l'ajout de deux équipes en {{1re}} division féminine, passant ainsi de huit à dix clubs. Chaque équipe se rencontre désormais deux fois dans un mode aller-retour classique. Saki Kumagai dispute son premier match de la saison le {{date-|4|avril}} face au club de Fukuoka pour le compte de la {{1re|journée}} de [[Championnat du Japon de football féminin|championnat]] à domicile au stade Komaba de [[Saitama]] ; elle joue l'intégralité de la rencontre et les Reds s'imposent {{Abréviation discrète|2-0|Deux buts à zéro}}. Elle marque le premier but de sa saison le {{date-|11|avril}} lors de la journée suivante contre l'Iga FC à la {{30e|minute}}. Les [[Urawa Red Diamonds Ladies|Urawa Red Diamonds]] participent à la [[Coupe de la Ligue japonaise de football féminin|Coupe de la Ligue]] qui a lieu au mois d'[[août]] ; Saki Kumagai dispute les dix dernières minutes de la demi-finale contre l'[[INAC Kobe Leonessa|INAC Kobe]], le {{date-|14|août}}, remportée {{Abréviation discrète|3-2|Trois buts à deux}}. Elle entre en jeu également en fin de rencontre lors de la finale le {{date-|22|août}} contre le [[NTV Beleza]] ; Alors que le [[Urawa Red Diamonds Ladies|club de Saitama]] a la main sur la rencontre en menant {{nombre|2|buts}} à 1, Saki Kumagai et ses coéquipières se font surprendre à la {{87e}} et la {{90e|minute}} et perdent le match {{Abréviation discrète|3-2|Trois buts à deux}}. Alors qu'elles tiennent tête au [[NTV Beleza]] au classement, le tournant du championnat a lieu à la {{16e|journée}} sur la pelouse de l'[[INAC Kobe Leonessa|INAC Kobe]] le {{date-|17|octobre}} ; titulaire en défense, Saki Kumagai assiste impuissante à l'ouverture du score des lionnes de [[Kōbe]] à la {{85e|minute}} et [[Urawa Red Diamonds Ladies|Urawa]] perd le match {{Abréviation discrète|1-0|Un but à zéro}}. Une défaite déterminante dans la course au titre puisqu'elle met le club dans une situation inconfortable avant de recevoir les joueuses [[NTV Beleza|tokyoïtes]] à la dernière journée le {{date-|31|octobre}} ; les Reds laissent d'ailleurs échapper rapidement la rencontre et perdent {{Abréviation discrète|3-0|Trois buts à zéro}}. Les joueuses du [[NTV Beleza]] s’adjugent leur onzième titre de [[Championnat du Japon de football féminin|championne du Japon]]. Saki Kumagai dispute la totalité des matchs de son équipe pour la deuxième saison consécutive et finit à la deuxième place du [[Championnat du Japon de football féminin|championnat]].

Le {{date-|19|décembre}}, les joueuses de [[Saitama]] entament aisément leur campagne en [[Coupe du Japon féminine de football|Coupe du Japon]] en écrasant le lycée Kamimura Gakuen {{Abréviation discrète|6-0|Six buts à zéro}} au troisième tour de la compétition ; la native de [[Sapporo]] en profite pour inscrire un doublé à la {{66e}} et {{92e|minute}}. En quarts de finale le {{date-|23|décembre}}, elles rencontrent le [[JEF United Ichihara Chiba Ladies|club de Chiba]] et s'imposent {{Abréviation discrète|1-0|Un but à zéro}} grâce à un but marqué en début de rencontre. En demi-finale le {{date-|26|décembre}}, elles affrontent l'[[Albirex Niigata Ladies|Albirex Niigata]] et remportent le match {{Abréviation discrète|3-1|Trois buts à un}}. En finale le {{date-|1|janvier}}, elles sont opposées à l'[[INAC Kobe Leonessa|INAC Kobe]]. Le match s'achève sur un match nul {{Abréviation discrète|1-1|Un but partout}} et la [[Tirs au but|séance de tirs au but]] est programmée directement ; Saki Kumagai n'y participe pas et voit son équipe s'incliner {{Abréviation discrète|3-2|Trois tirs au but à deux}}. À l'issue de la [[2010 en football|saison 2010]], Saki Kumagai est vice-[[Championnat du Japon de football féminin|championne du Japon]] et marque {{nombre|8|buts}} toutes compétitions confondues.
{{Boîte déroulante/début|titre=Résultats de Saki Kumagai sur la saison|alignB=centre|align=justify|alignT=right|largeur=70%|couleurFondT=transparent|couleurFondB=transparent|arrondi=0.6em}}

{{Boîte déroulante/fin}}

Le début de [[2011 en football|saison 2011]] est marqué par le [[Séisme de 2011 de la côte Pacifique du Tōhoku|séisme de la côte Pacifique du Tōhoku]] du {{date-|11|mars}}. Le [[Championnat du Japon de football féminin|championnat]] ne reprend qu'à la {{5e|journée}} le {{date-|29|avril}} contre [[Okayama Yunogo Belle|Okayama]] ; Saki Kumagai joue l'intégralité de la rencontre et les deux équipes se séparent sur un match nul {{Abréviation discrète|0-0|Zéro but partout}}. Elle s'engage avec le [[1. FFC Francfort|FFC Francfort]] au printemps<ref name=":3">{{Lien web|langue=allemand|titre=Une internationale nippone arrive|url=http://www.framba.de/content/index.php?option=com_content&view=article&id=2140%3Afrankfurt-verpflichtet-japanische-nationalspielerin&catid=46%3Atransfers|site=framba.de|date=31 mai 2011}}.</ref>, juste avant la [[Coupe du monde féminine de football 2011|Coupe du monde]]. Elle suspend ses études supérieures au milieu de sa troisième année<ref name=":2" />. Elle ne joue que {{nombre|5|matchs}} de [[Championnat du Japon de football féminin|championnat]] avec les Reds au cours de cette saison et ne marque aucun but ; l'équipe finit à la troisième place du [[Championnat du Japon de football féminin|championnat]]. Avant de s'expatrier en [[Allemagne]], elle aura joué {{nombre|54|matchs}} et marqué {{nombre|11|buts}} avec le [[Urawa Red Diamonds Ladies|club de Saitama]].
{{Boîte déroulante/début|titre=Résultats de Saki Kumagai sur la saison|alignB=centre|align=justify|alignT=right|largeur=70%|couleurFondT=transparent|couleurFondB=transparent|arrondi=0.6em}}

{{Boîte déroulante/fin}}

[[Fichier:UEFA Womens Champions League finale 2012.JPG|thumb|alt=Saki Kumagai en Ligue des champions 2011-2012|[[Stade olympique de Munich]] lors de la finale de la [[Ligue des champions féminine de l'UEFA 2011-2012|Ligue des champions 2012]].|260x260px]]
Au printemps [[2011]], Saki Kumagai effectue un essai convaincant au [[1. FFC Francfort|FFC Francfort]]<ref name=":3" /> qui la recrute pour un contrat de deux saisons<ref>{{Lien web|langue=Allemand|titre=Kumagai vient renforcer le FFC|url=http://www.kicker.de/news/fussball/frauen/startseite/553274/artikel_japanerin-kumagai-verstaerkt-den-ffc.html#omsearchresult|site=kicker.de|date=31 mai 2011}}.</ref>. Elle rejoint définitivement le club après la [[Coupe du monde féminine de football 2011|Coupe du monde 2011]]. Elle retrouve en [[Championnat d'Allemagne de football féminin 2011-2012|Fraun-Bundesliga]] deux autres internationales japonaises, [[Kozue Andō]] et [[Yūki Ōgimi]]. Elle dispute son premier match le {{date-|21|août|2011}} contre le [[SG Essen-Schönebeck|SG Essen]] pour le compte de la {{1re|journée}} de [[Championnat d'Allemagne de football féminin 2011-2012|championnat]] à domicile au [[Stadion am Brentanobad]] ; titulaire en début de match, elle est remplacée à la {{70e|minute}} par la joueuse américaine [[Ali Krieger]]. Près d'un mois plus tard, le {{date-|28|septembre}}, elle découvre la [[Ligue des champions féminine de l'UEFA 2011-2012|Ligue des champions]] contre le club [[Norvège|norvégien]] [[Stabæk Fotball]] en seizième de finale aller à [[Bærum]] mais les joueuses allemandes perdent {{Abréviation discrète|1-0|Un but à zéro}}. Elles se rattrapent une semaine plus tard à domicile en éliminant les norvégiennes de la [[Ligue des champions féminine de l'UEFA 2011-2012|compétition]] {{Abréviation discrète|4-1|Quatre buts à un}} et se qualifient pour les huitièmes de finale.

{{images |position=gauche|Lyon-francfort-2012-05-17.png|alt=Composition des équipes lors de la finale|légende= Composition des équipes lors de la finale de [[Ligue des champions féminine de l'UEFA 2011-2012|WCL 2012]] face à l'[[Olympique lyonnais (féminines)|Olympique lyonnais]].|hauteur  = 290}}
Le {{date-|2|octobre}}, elle marque son premier but avec son nouveau club contre [[SC 07 Bad Neuenahr|Neuenahr]] à l'occasion de la {{5e|journée}} de [[Championnat d'Allemagne de football féminin 2011-2012|championnat]] ; à la suite d'un corner, elle réceptionne la balle au second poteau et marque du pied gauche à la {{84e|minute}}. Le {{date-|2|novembre|2011}}, les Allemandes affrontent le [[Paris Saint-Germain Football Club (féminines)|Paris Saint-Germain]] en huitième de finale aller à domicile et s'imposent facilement {{Abréviation discrète|3-0|Trois buts à zéro}}<ref>{{Lien web|titre=Paris corrigé à Francfort|url=https://www.lequipe.fr/Football/Actualites/Paris-corrige-a-francfort/240467|site=lequipe.fr|date=2 novembre 2011}}.</ref>. Une semaine plus tard, le match retour au [[stade Charléty]] est plus compliqué et malgré une défaite {{Abréviation discrète|2-1|Deux buts à un}}, les Allemandes sont qualifiées pour le tour suivant<ref>{{Lien web|titre=Le PSG éliminé|url=http://www.football365.fr/c1-8emes-le-psg-elimine-1825959.html|site=football365.fr|date=9 novembre 2011}}.</ref>. En quart de finale, [[1. FFC Francfort|Francfort]] est opposé au [[FC Rosengård (football féminin)|FC Rosengård]]. En déplacement à [[Malmö]] au match aller le {{date-|15|mars|2012}}, les suédoises s'imposent {{Abréviation discrète|1-0|Un but à zéro}}. Saki Kumagai ne dispute pas le match retour à domicile le {{date-|21|mars}} mais ses coéquipières parviennent tout de même à se qualifier pour les demi-finales en battant les Suédoises {{Abréviation discrète|3-0|Trois buts à zéro}}. En demi-finale aller le {{date-|15|avril}}, les Allemandes affrontent les Anglaises d'[[Arsenal Ladies Football Club|Arsenal]] au [[Meadow Park (Borehamwood)|Meadow Park]] et s'imposent {{Abréviation discrète|2-1|Deux buts à un}} grâce à un but de [[Kerstin Garefrekes]] à la {{93e|minute}}. Le {{date-|21|avril}}, [[1. FFC Francfort|Francfort]] entérine sa qualification pour la finale en dominant les Anglaises {{Abréviation discrète|2-0|Deux buts à zéro}} à domicile.

Préférée à [[Fatmire Alushi|Lira Alushi]], Saki Kumagai ne participe pas à la défaite de [[1. FFC Francfort|Francfort]] {{Abréviation discrète|2-0|Deux buts à zéro}} en finale de la [[Coupe d'Allemagne féminine de football 2011-2012|Coupe d'Allemagne 2012]] contre le [[Bayern Munich (féminines)|Bayern Munich]] le {{date-|12|mai|2012}}<ref name=":0">{{Lien web|langue=Allemand|titre=Bayern vainqueur après 3 tentatives|url=http://www.kicker.de/news/fussball/frauen/dfbpokalfr/dfb-pokal-frauen/2011-12/6/1426976/spielanalyse_1-ffc-frankfurt-3447_bayern-muenchen-3444.html#omsearchresult|site=kicker.de|date=12 mai 2017}}.</ref>. Le {{date-|17|mai}}, elle participe à sa première finale de [[Ligue des champions féminine de l'UEFA 2011-2012|Ligue des champions]] mais le sacre européen lui échappe au profit de l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] qui remporte la rencontre {{Abréviation discrète|2-0|Deux buts à zéro}}<ref>{{Lien web|titre=Lyon conserve la LDC|url=http://www.football365.fr/lyon-conserve-la-ligue-des-champions-en-simposant-contre-francfort-1271907.html|site=football365.fr|date=18 mai 2012}}.</ref>. Le soir de la finale, le club allemand est pourtant soutenu par un peu plus de {{nombre|50000|spectateurs}} au [[Stade olympique de Munich]], établissant le record d'affluence pour cette [[Ligue des champions féminine de l'UEFA 2011-2012|compétition]]<ref>{{Lien web|titre=Lyon garde sa patte sur l'Europe|url=http://fr.uefa.com/womenschampionsleague/news/newsid=1798418.html|site=fr.uefa.com|date=17 mai 2012}}.</ref>. À l'issue de la [[Championnat d'Allemagne de football féminin 2011-2012|saison 2011-2012]], elle marque {{nombre|2|buts}} toutes compétitions confondues et finit à la troisième place du [[Championnat d'Allemagne de football féminin 2011-2012|championnat]] derrière le [[1. FFC Turbine Potsdam|Turbine Potsdam]] et le [[VfL Wolfsburg (féminines)|VfL Wolfbourg]], ce qui ne permet pas de qualification pour les prochaines [[Ligue des champions féminine de l'UEFA 2012-2013|échéances européennes]]. Une fin de saison difficile à digérer pour les Allemandes qui, en l'espace de quelques jours, ont laissé échapper deux trophées majeurs.
{{Boîte déroulante/début|titre=Résultats de Saki Kumagai sur la saison|alignB=centre|align=justify|alignT=right|largeur=70%|couleurFondT=transparent|couleurFondB=transparent|arrondi=0.6em}}

{{Boîte déroulante/fin}}

À l'entame de la [[Championnat d'Allemagne de football féminin 2012-2013|saison 2012-2013]], le [[1. FFC Francfort|FFC Francfort]] n'est pas qualifié pour la [[Ligue des champions féminine de l'UEFA 2012-2013|Ligue des champions]] et doit se contenter du [[Championnat d'Allemagne de football féminin 2012-2013|championnat]] et de la [[Coupe d'Allemagne féminine de football 2012-2013|Coupe nationale]]. En manque de solutions dans le jeu depuis quelques mois<ref>{{Lien web|titre=Qui est le FFC Francfort ?|url=http://www.olweb.fr/fr/article/qui-est-le-ffc-francfort-59498.html|site=olweb.fr|date=15 mai 2012}}.</ref>, le club se sépare de son entraîneur Sven Kahlert le {{date-|12|septembre|2012}} (en place depuis {{date-||mai|2009}}) et est remplacé provisoirement par un de ses entraîneurs adjoints Philipp Dahm<ref>{{Lien web|langue=Allemand|titre=Francfort se sépare de Sven Kahlert|url=http://www.faz.net/aktuell/rhein-main/frauenfussball-1-ffc-frankfurt-entlaesst-cheftrainer-kahlert-11887461.html|site=faz.net|date=12 septembre 2012}}.</ref>. Début septembre, peu avant le l'ouverture du championnat, Saki Kumagai se blesse à l'entraînement lors d'un choc avec une coéquipière qui retombe sur sa main droite<ref>{{Lien web|langue=Anglais|titre=Nouvelles de l'infirmerie|url=http://ffc-frankfurt.tumblr.com/post/31010120202/ffc-hospital-news|site=tumblr.com|date=6 septembre 2012}}.</ref> ; elle se fracture le [[métacarpe]] et souffre également d'une grosse  [[contusion]] à l'annulaire mais ses blessures ne nécessitent pour autant pas de chirurgie.

Saki Kumagai reprend la compétition à la {{5e|journée}} de [[Championnat d'Allemagne de football féminin 2012-2013|championnat]] lors de la réception du [[FSV Gütersloh 2009|FSV Gütersloh]] le {{date-|3|octobre|2012}} ; les deux équipes se séparent sur un match nul {{Abréviation discrète|1-1|Un but partout}}. Quatre jours plus tard, le {{date-|7|octobre}}, elle participe à l'élimination des francfortiennes dès le deuxième tour de la [[Coupe d'Allemagne féminine de football 2011-2012|Coupe d'Allemagne]] par le [[Bayern Munich (féminines)|Bayern Munich]] aux tirs au but ({{Abréviation discrète|1-1|Un but partout}} [[Tirs au but|tab]] {{Abréviation discrète|5-3|Cinq tirs au but à trois}}) ; elle ne prend pas part à la séance. La japonaise dispute la totalité des matchs restants en [[Championnat d'Allemagne de football féminin 2012-2013|championnat]] en tant que titulaire avec des résultats mitigés. À l'issue de la [[Championnat d'Allemagne de football féminin 2012-2013|saison 2012-2013]], elle finit à nouveau à la troisième place du [[Championnat d'Allemagne de football féminin 2012-2013|championnat]] derrière le [[VfL Wolfsburg (féminines)|VfL Wolfbourg]] et le [[1. FFC Turbine Potsdam|Turbine Potsdam]]. Saki Kumagai ne renouvelle pas son contrat en [[Allemagne]] et aura joué {{nombre|50|matchs}} (dont {{nombre|8|matchs}} de [[Ligue des champions féminine de l'UEFA|Ligue des champions]]) et marqué {{nombre|2|buts}} avec le [[1. FFC Francfort|club du Main]].
