{{Boîte déroulante/fin}}

Saki Kumagai dispute son premier match de la saison le {{date-|30|août|2015}} face sur la pelouse de [[Vie au grand air de Saint-Maur (football)|Saint-Maur]] pour le compte de la {{1re|journée}} de [[Championnat de France de football féminin 2015-2016|championnat]] ; elle joue l'intégralité de la rencontre et les Lyonnaises s'imposent {{Abréviation discrète|7-0|Sept buts à zéro}}<ref>{{Lien web|titre=Saint-Maur - OL féminin : 0 - 7|url=http://www.olweb.fr/fr/article/saint-maur-a-ol-feminin-0-7-68754.html|site=olweb.fr|date=30 août 2015}}.</ref>. Elle marque son premier but de la saison le {{date-|13|septembre}} sur [[Loi 14 du football|penalty]] à la {{69e|minute}} lors de la victoire {{Abréviation discrète|8-0|Huit buts à zéro}} contre [[En avant Guingamp (féminines)|Guingamp]] pour le compte de la {{3e|journée}} de [[Championnat de France de football féminin 2015-2016|championnat]]<ref>{{Lien web|titre=Guingamp -OL féminin : 0 - 8|url=http://www.olweb.fr/fr/article/ol-feminin-68819.html|site=olweb.fr|date=13 septembre 2015}}.</ref>. L'[[Olympique lyonnais (féminines)|Olympique lyonnais]] commence son parcours en [[Ligue des champions féminine de l'UEFA 2015-2016|Ligue des champions]] le {{date-|8|octobre}}, en disposant du [[Medyk Konin]] {{Abréviation discrète|6-0|Six buts à zéro}} en seizième de finale aller en déplacement en [[Pologne]]<ref>{{Lien web|titre=LDC : Lyon sans souci|url=http://www.footdelles.com/article/Actus-Chronos_LDC-Lyon-sans-souci_119218.html|site=footdelles.com|date=8 octobre 2015}}.</ref>. Au match retour, le {{date-|14|octobre}}, elles se qualifient pour en huitième de finale grâce à un succès {{Abréviation discrète|3-0|Trois buts à zéro}} au [[Matmut Stadium Gerland|stade de Gerland]]<ref>{{Lien web|titre=L'OL confirme sa qualification|url=https://www.lequipe.fr/Football/Actualites/Ligue-des-champions-f-l-ol-bat-medyk-konin-3-0-et-confirme-sa-qualification-pour-les-huitiemes-de-finale/598877|site=lequipe.fr|date=14 octobre 2015}}.</ref> ; Saki Kumagai joue l'intégralité des deux confrontations. Le {{date-|11|novembre}}, l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] affronte l'[[Club Atlético de Madrid (féminines)|Athlético de Madrid]] en huitième de finale aller en déplacement en [[Espagne]]. Les rhodaniennes remportent la rencontre {{Abréviation discrète|3-1|Trois buts à un}}<ref>{{Lien web|titre=LDC : victoire et émotions|url=http://www.footdelles.com/article/Actus-Chronos_LDC-Une-victoire-et-des-emotions-pour-Lyon_121292.html|site=footdelles.com|date=11 novembre 2015}}.</ref>. Le {{date-|18|novembre}}, elles s'imposent de nouveau au match retour {{Abréviation discrète|6-0|Six buts à zéro}} ; à cette occasion, la Japonaise marque son deuxième but de la saison sur [[Loi 14 du football|penalty]] juste avant la mi-temps<ref>{{Lien web|titre=L'OL valide son billet|url=https://www.lequipe.fr/Football/Actualites/L-ol-valide-son-billet-pour-les-quarts-de-finale/608794|site=lequipe.fr|date=18 novembre 2015}}.</ref>. C'est la dernière fois que l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] joue au [[Matmut Stadium Gerland|stade de Gerland]] en [[Ligue des champions féminine de l'UEFA|coupe d'Europe]].

{{images |position=droite|Lyon-wolfsurg-2016-05-26 (3).png|alt=Composition des équipes lors de la finale|légende= Composition des équipes lors de la finale de [[Ligue des champions féminine de l'UEFA 2015-2016|WCL 2016]] face au [[VfL Wolfsburg (féminines)|VfL Wolfsburg]].|hauteur  = 278}}
Le {{date-|13|janvier|2016}}, elle prolonge à nouveau son contrat jusqu'en {{date-||juin|2017}}<ref>{{Lien web|titre=Saki Kumagai prolonge un d'an|url=http://www.francefootball.fr/news/Saki-kumagai-prolonge-un-an-a-lyon/624205|site=francefootball.fr|date=13 janvier 2016}}.</ref>. Le {{date-|23|mars}}, l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] joue face aux Tchèques du [[SK Slavia Prague (féminines)|Slavia Prague]] en quarts de finale aller de la [[Ligue des champions féminine de l'UEFA 2015-2016|Ligue des champions]] pour leur première rencontre officielle dans le nouveau stade [[Parc Olympique lyonnais]] de [[Décines-Charpieu]]. Les Lyonnaises font rapidement exploser le [[SK Slavia Prague (féminines)|Slavia]] {{Abréviation discrète|9-1|Neuf buts à un}}<ref>{{Lien web|titre=Lyon en démonstration au Parc OL|url=https://www.lequipe.fr/Football/Actualites/Ligue-des-champions-lyon-en-demonstration-au-parc-ol-a-deja-un-pied-en-demi-finale/646042|site=lequipe.fr|date=23 mars 2016}}.</ref>. La Japonaise et ses coéquipières se contentent de gérer sans pour autant arriver à trouver la faille lors du match retour le {{date-|30|mars}} à [[Prague]] {{Abréviation discrète|0-0|Zéro but partout}}<ref>{{Lien web|titre=L'OL tenu en échec mais qualifié|url=https://www.lequipe.fr/Football/Actualites/Ligue-des-champions-feminine-l-olympique-lyonnais-tenu-en-echec-par-le-slavia-prague-mais-qualifie/648042|site=lequipe.fr|date=30 mars 2016}}.</ref>.

[[Fichier:Ballon de la finale de la Champions League féminine 2015 (cropped).JPG|thumb|alt=Ballon WCL 2016|Ballon de la finale de la [[Ligue des champions féminine de l'UEFA 2015-2016|Ligue des champions 2015-2016]].|230px|gauche]] Titulaire au milieu de terrain devant une défense à trois, elle assiste au nouveau record d'affluence de l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] établi le {{date-|24|avril}} au [[Parc Olympique lyonnais|Parc OL]] avec {{nombre|22050|spectateurs}}<ref>{{Lien web|titre=Record d’affluence au Parc OL|url=http://www.olympique-et-lyonnais.com/ol-psg-record-daffluence-au-parc-ol,118013.html|site=ol-et-lyonnais.com|date=25 avril 2016}}.</ref> venus célébrer la revanche sévère des fenottes {{Abréviation discrète|7-0|Sept buts à zéro}} contre le [[Paris Saint-Germain Football Club (féminines)|Paris Saint-Germain]] en demi-finale aller de la [[Ligue des champions féminine de l'UEFA 2015-2016|Ligue des champions]]<ref>{{Lien web|titre=L'OL déjà en finale|url=http://www.leprogres.fr/ol/2016/04/24/l-ol-mene-5-0-a-la-pause-face-au-psg|site=leprogres.fr|date=24 avril 2016}}.</ref>. Au match retour, le {{date-|2|mai}} au [[Parc des Princes|Parc des princes]], les Lyonnaises gèrent tranquillement leur avance et remportent le match {{Abréviation discrète|1-0|Un but à zéro}} ; Saki Kumagai n'entame pas la rencontre et entre en jeu à la {{61e|minute}} à la place de [[Griedge Mbock]]<ref>{{Lien web|titre=Lyon rejoint Wolfsburg en finale|url=https://www.lequipe.fr/Football/Actualites/Lyon-rejoint-wolfsburg-en-finale-de-la-ligue-des-champions/666495|site=lequipe.fr|date=2 mai 2016}}.</ref>. Le {{date-|8|mai}}, les Lyonnaises conservent mathématiquement leur titre de [[Championnat de France de football féminin 2015-2016|championnes de France]] à la {{21e|journée}} sur la pelouse de [[Association sportive jeunesse Soyaux-Charente|Soyaux]] grâce à un match remporté {{Abréviation discrète|5-1|Cinq buts à un}}<ref>{{Lien web|titre=Championnes de France à Soyaux|url=http://www.olweb.fr/fr/article/championnes-de-france-a-soyaux-5-1-70708.html|site=olweb.fr|date=8 mai 2016}}.</ref>. Le {{date-|15|mai}}, elles atteignent encore la finale de la [[Coupe de France féminine de football 2015-2016|Coupe de France]] et remportent la compétition face à [[Montpellier Hérault Sport Club (féminines)|Montpellier]] au [[stade des Alpes]] de [[Grenoble]] grâce à une victoire {{Abréviation discrète|2-1|Deux buts à un}} acquise dans la douleur en fin de rencontre grâce à [[Louisa Necib]] qui marque d'une frappe puissante dans la lucarne montpelliéraine à la {{85e|minute}} de jeu<ref>{{Lien web|titre=L'OL s'impose au finish|url=http://www.footdelles.com/article/Coupe-de-France_LOL-simpose-au-finish_132300.html|site=footdelles.com|date=15 mai 2016}}.</ref>.

Le {{date-|26|mai|2016}} au [[Stadio di Reggio Emilia Città del Tricolore|stadio Città del Tricolore]] de [[Reggio d'Émilie]], Saki Kumagai s'illustre en marquant le dernier tir au but de la finale de la [[Ligue des champions féminine de l'UEFA 2015-2016|Ligue des champions]] qui permet à l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] de remporter son troisième titre européen face au [[VfL Wolfsburg (féminines)|VfL Wolfsburg]] {{Abréviation discrète|1-1|Un but partout}} ([[Tirs au but|tab]] {{Abréviation discrète|4-3|Quatre tirs au but à trois}})<ref>{{Lien web|titre=L'OL remporte la LDC face à Wolfsburg|url=https://www.lequipe.fr/Football/Actualites/L-ol-remporte-la-ligue-des-champions/682820|site=lequipe.fr|date=26 mai 2016}}.</ref> ; après une grande prise d'élan, elle frappe du plat du pied à mi-hauteur sur la droite de la gardienne prise à contre-pied. Lors de la finale, elle évolue au poste de [[milieu défensif]] devant une défense à trois. Elle est élue meilleure joueuse de la finale<ref name=":6">{{Lien web|titre=L’OL remporte sa {{3e}} LDC féminine|url=https://www.lemonde.fr/football/article/2016/05/26/lyon-remporte-la-ligue-des-champions-feminine-face-a-wolfsburg-aux-tirs-au-but_4927322_1616938.html|site=lemonde.fr|date=26 mai 2016}}.</ref>, ce qui constitue sa première distinction personnelle. C'est la quatrième joueuse japonaise à remporter la Coupe d'Europe après [[Yūki Ōgimi]], [[Ami Ōtaki]] et [[Kozue Andō]]<ref name=":10">{{Lien web|langue=japonais|titre={{2e}} WCL consécutives|url=https://www.footballchannel.jp/2017/06/02/post214085/|site=footballchannel.jp|date=2 juin 2017}}.</ref>. À l'issue de la [[Saison 2015-2016 de l'Olympique lyonnais (féminines)|saison 2015-2016]], Saki Kumagai réalise le triplé historique, marque {{nombre|7|buts}} (dont {{nombre|5|penaltys}}) et délivre {{nombre|4|passes décisives}} toutes compétitions confondues. Sa qualité de relance lui permet désormais d'être régulièrement positionnée au [[milieu de terrain]] par [[Gérard Prêcheur]]. Grâce à ses prestations abouties, elle est nommée dans le {{nobr|top 10}} des [[Prix UEFA du Meilleur joueur d'Europe|meilleures joueuses en Europe de l'UEFA]] pour la [[Saison 2015-2016 de l'Olympique lyonnais (féminines)|saison 2015-2016]]<ref>{{Lien web|titre=Joueuse UEFA : huit Lyonnaises nommées|url=https://www.lequipe.fr/Football/Actualites/Meilleure-joueuse-europeenne-huit-lyonnaises-nommees/707608|site=lequipe.fr|date=18 juillet 2016}}.</ref>.
