[[Fichier:Saki Kumagai 2017.jpg|thumb|alt=Saki Kumagai 2017|Saki Kumagai à l'[[Groupama OL Training Center|OL Training Center]] en {{date-||février|2017}}.|droite|340x340px]]
tSaki Kumagai dispute son premier match de la saison le {{date-|11|septembre|2016}} au [[stade Camille-Lebon]] face à [[Association sportive jeunesse Soyaux-Charente|Soyaux]] pour le compte de la {{1re|journée}} de [[Championnat de France de football féminin 2016-2017|championnat]] ; elle joue l'intégralité de la rencontre et les Lyonnaises s'imposent largement {{Abréviation discrète|9-0|Neuf buts à zéro}}<ref>{{Lien web|titre=L'OL lance parfaitement sa saison|url=http://www.olweb.fr/fr/article/feminines-l-ol-lance-parfaitement-sa-saison-a-saint-maur-0-0-71667.html|site=olweb.fr|date=11 septembre 2016}}.</ref>. Elle marque son premier but de la saison le {{date-|2|octobre}} sur penalty à la {{91e|minute}} lors de la victoire {{Abréviation discrète|4-0|Quatre buts à zéro}} contre [[Association sportive de Saint-Étienne (féminines)|Saint-Étienne]] pour le compte de la {{3e|journée}} de [[Championnat de France de football féminin 2016-2017|championnat]]<ref>{{Lien web|titre=L'OL survol le derby|url=http://www.olweb.fr/fr/article/feminines-l-ol-remporte-le-derby-a-saint-etienne-0-1-71936.html|site=olweb.fr|date=2 octobre 2016}}.</ref>. Le {{date-|5|octobre}}, les [[Ligue des champions féminine de l'UEFA|championnes d'Europe]] remettent leur titre en jeu sur la pelouse du club norvégien d'[[Avaldsnes IL]] en seizième de finale aller ; Saki Kumagai marque le premier but de la rencontre sur [[Loi 14 du football|penalty]] à la {{7e|minute}} et les Lyonnaises remportent le match {{Abréviation discrète|5-2|Cinq buts à deux}}<ref>{{Lien web|titre=Lyon, fébrile, fait la différence|url=http://www.footdelles.com/article/Actus-Chronos_Lyon-febrile-fait-la-difference-des-le-match-aller_139554.html|site=footdelles.com|date=5 octobre 2016}}.</ref>. Elle joue son {{100e|match}} officiel avec l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] le {{date-|12|octobre}} lors du match retour au [[Parc Olympique lyonnais|Parc OL]] ; elle remplace [[Wendie Renard]] à la mi-temps et les Lyonnaises se qualifient facilement pour les huitièmes de finale {{Abréviation discrète|5-0|Cinq buts à zéro}}<ref>{{Lien web|titre=Victoire pour Lyon, qualifié en 1/8e|url=http://www.footdelles.com/article/Actus_LDC-Large-victoire-pour-Lyon-qualifie-en-1-8e_140002.html|site=footdelles.com|date=12 octobre 2016}}.</ref>.

Au tour suivant le {{date-|9|novembre}}, les fenottes rencontrent les suissesses du [[FC Zürich Frauen|FC Zurich]] et les dominent {{Abréviation discrète|8-0|Huit buts à zéro}} au [[Parc Olympique lyonnais|Parc OL]] dès le match aller ; la Japonaise remplace [[Dzsenifer Marozsán]] à la mi-temps<ref>{{Lien web|titre=L'OL a corrigé Zurich|url=https://www.lequipe.fr/Football/Actualites/L-ol-a-corrige-zurich-en-huitiemes-de-finale-aller-de-la-ligue-des-champions/747682|site=lequipe.fr|date=9 novembre 2016}}.</ref>. Une semaine plus tard le {{date-|16|novembre}}, les Lyonnaises assurent encore le spectacle {{Abréviation discrète|9-0|Neuf buts à zéro}} au [[Stade du Letzigrund|Letzigrund Stadion]] de [[Zurich]] et valident leur qualification ; titulaire devant la défense lyonnaise, Saki Kumagai inscrit le {{1900e|but}} de l'histoire du club sur une frappe taclée du pied droit dans la surface grâce à une remise de [[Camille Abily]] à la {{42e|minute}}<ref>{{Lien web|titre=Lyon pulvérise (encore) Zurich|url=https://www.lequipe.fr/Football/Actualites/Lyon-pulverise-encore-zurich-en-ligue-des-champions-feminine/750063|site=lequipe.fr|date=16 novembre 2016}}.</ref>. Le {{date-|23|mars|2017}}, les joueuses de [[Gérard Prêcheur]] retrouvent le redoutable [[VfL Wolfsburg (féminines)|VfL Wolfsburg]] à l'AOK Stadion, en quart de finale aller de la [[Ligue des champions féminine de l'UEFA 2016-2017|Ligue des champions]] ; Saki Kumagai est titulaire au [[milieu de terrain]] et voit son équipe s'imposer {{Abréviation discrète|2-0|Deux buts à zéro}}<ref>{{Lien web|titre=L’OL féminin fait le plus dur à Wolfsburg|url=http://www.leliberolyon.fr/lol-feminin-fait-dur-wolfsburg-0-2/76173|site=leliberolyon.fr|date=24 mars 2017}}.</ref>. Au match retour, le {{date-|29|mars}} au [[Parc Olympique lyonnais|Parc OL]], les Lyonnaises sont acculées toute la rencontre par des louves revanchardes et perdent {{Abréviation discrète|1-0|Un but à zéro}}<ref>{{Lien web|titre=Lyon a tremblé mais jouera les 1/2|url=https://www.lequipe.fr/Football/Actualites/Lyon-a-tremble-mais-jouera-les-demi-finales-de-la-ligue-des-champions-feminine/789210|site=lequipe.fr|date=29 mars 2017}}.</ref>, mais les rhodaniennes se qualifient tout de même pour le dernier carré avec soulagement ; Saki Kumagai démarre le match au [[milieu de terrain]] puis elle est remplacée par [[Caroline Seger]] à la {{62e|minute}}.

{{images |position=gauche|Lyon-psg-2017-06-01.png|alt=Composition des équipes lors de la finale|légende= Composition des équipes lors de la finale de [[Ligue des champions féminine de l'UEFA 2016-2017|WCL 2017]] face au [[Paris Saint-Germain (féminines)|Paris Saint-Germain]].|hauteur  = 290}}
Le {{date-|22|avril}}, les Lyonnaises se déplacent à l'[[Academy Stadium]] de [[Manchester City Women's Football Club|Manchester City]] pour la demi-finale aller et remportent le match {{Abréviation discrète|3-1|Trois buts à un}}<ref>{{Lien web|titre=Les Lyonnaises entrevoient la finale|url=http://www.sofoot.com/c1-les-lyonnaises-entrevoient-la-finale-441931.html|site=sofoot.com|date=22 avril 2017}}.</ref> ; la Japonaise transforme un penalty dès la {{2e|minute}}. Au match retour le {{date-|29|avril}}, devant {{nombre|19214|spectateurs}}<ref>{{Lien web|titre=Les Lyonnaises rejoignent le PSG|url=http://www.olweb.fr/fr/article/ldc-feminine-malgre-une-defaite-1-0-les-lyonnaises-rejoignent-le-psg-en-finale-30811.html|site=olweb.fr|date=29 avril 2017}}.</ref> au [[Parc Olympique lyonnais|Parc OL]], les fenottes perdent le match {{Abréviation discrète|1-0|Un but à zéro}} avec l'ouverture du score de [[Carli Lloyd]] à la {{57e|minute}} mais elles se qualifient tout de même pour la finale<ref>{{Lien web|titre=Lyon perd mais rejoint le PSG en finale|url=https://www.lequipe.fr/Football/Actualites/Lyon-perd-mais-rejoint-le-psg-en-finale/797309|site=lequipe.fr|date=29 avril 2017}}.</ref>. Le {{date-|4|mai}}, Saki Kumagai prolonge son contrat avec l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] de trois saisons supplémentaires jusqu'en {{date-||juin|2020}}<ref>{{Lien web|titre=Kumagai prolonge jusqu'en 2020|url=http://www.eurosport.fr/football/division-1-feminine/2016-2017/transferts-kumagai-prolonge-a-lyon-jusqu-en-2020_sto6153110/story.shtml|site=eurosport.fr|date=4 mai 2017}}.</ref>. Le {{date-|8|mai}}, les Lyonnaises sont officiellement [[Championnat de France de football féminin 2016-2017|championnes de France]] pour la onzième fois consécutive lors de la victoire {{Abréviation discrète|9-0|Neuf buts à zéro}} contre [[Association sportive jeunesse Soyaux-Charente|Soyaux]] à la {{20e}} journée<ref>{{Lien web|titre=Les Lyonnaises remportent un quinzième titre|url=https://www.lequipe.fr/Football/Actualites/Apres-leur-festival-a-soyaux-les-lyonnaises-remportent-un-quinzieme-titre-en-d1-feminine/799593|site=lequipe.fr|date=8 mai 2017}}.</ref>. Le {{date-|19|mai}}, les fenottes remportent la [[Coupe de France féminine de football 2016-2017|Coupe de France]] aux tirs au but face au [[Paris Saint-Germain Football Club (féminines)|Paris Saint-Germain]] ({{Abréviation discrète|1-1|Un but partout}} [[Tirs au but|tab]] {{Abréviation discrète|7-6|Sept tirs au but à six}})<ref>{{Lien web|titre=Lyon s'offre sa {{6e}} Coupe face au PSG|url=https://www.ouest-france.fr/sport/football/feminines-lyon-s-offre-sa-sixieme-coupe-d-affilee-5003582|site=ouest-france.fr|date=19 mai 2017}}.</ref> ; la Japonaise égalise sur [[penalty]] à la {{34e|minute}} puis elle rate le [[tir au but]] de la victoire en tirant sur le poteau gauche de la gardienne polonaise [[Katarzyna Kiedrzynek]] (son premier échec dans cet exercice), mais [[Ada Hegerberg]] offre finalement la victoire en fin de séance.

La finale de la [[Ligue des champions féminine de l'UEFA 2016-2017|Ligue des champions]] a lieu le {{date-|1|juin|2017}} au [[Cardiff City Stadium]] face au [[Paris Saint-Germain Football Club (féminines)|Paris Saint-Germain]] ; à l'image de leur rencontre en [[Coupe de France féminine de football 2016-2017|Coupe de France]], le match est assez fermé et les deux rivales se séparent sur un match nul {{Abréviation discrète|0-0|Zéro but partout}} à la fin du temps réglementaire mais l'[[Olympique lyonnais (féminines)|Olympique lyonnais]] l'emporte finalement aux [[tirs au but]] {{Abréviation discrète|7-6|Sept tirs au but à six}} grâce à [[Sarah Bouhaddi]]<ref>{{Lien web|titre=Lyon bat de nouveau le PSG en finale|url=https://www.lequipe.fr/Football/Actualites/Lyon-bat-de-nouveau-le-psg-en-finale-apres-une-seance-de-tirs-au-but/806581|site=lequipe.fr|date=1 juin 2017}}.</ref>. Titulaire au [[milieu de terrain]], Saki Kumagai participe aux {{nombre|120|minutes}} de jeu et réussit facilement<ref>{{Lien web|langue=anglais|titre=Kumagai remporte encore la WCL|url=https://english.kyodonews.net/news/2017/06/06409630470f-soccer-kumagai-lyon-win-back-to-back-champions-league.html|site=kyodonews.net|date=2 juin 2017}}.</ref> son [[Tirs au but|tir au but]] (plein centre à ras de terre) malgré l’échec quelques jours auparavant. C'est le quatrième titre européen glané par les Lyonnaises (égalant le [[1. FFC Francfort|FFC Francfort]]) qui deviennent au passage la première équipe à remporter les trois compétitions officielles sur deux années consécutives<ref>{{Lien web|titre=OL remporte la {{4e}} WCL de son histoire|url=https://www.lemonde.fr/ligue-des-champions/article/2017/06/02/football-feminin-lyon-remporte-la-quatrieme-ligue-des-champions-de-son-histoire_5137421_1616944.html|site=lemonde.fr|date=2 juin 2017}}.</ref>. Saki Kumagai devient la seule joueuse japonaise à remporter au moins deux Coupes d'Europe<ref name=":10" />. À l'issue de la [[Saison 2016-2017 de l'Olympique lyonnais (féminines)|saison 2016-2017]], la native de [[Sapporo]] réalise donc un nouveau triplé historique, marque {{nombre|11|buts}} (dont {{nombre|10|penaltys}}) et délivre {{nombre|3|passes décisives}} toutes compétitions confondues.
