Le {{date-|12|mai|2021}}, le [[Bayern Munich (féminines)|Bayern Munich]] annonce la signature de Saki Kumagai pour une durée de deux saisons<ref>{{Lien web|titre=OL. Saki Kumagai signe au Bayern Munich|url=https://www.ouest-france.fr/sport/football/olympique-lyonnais/ol-saki-kumagai-signe-au-bayern-munich-7f04a7fc-b30a-11eb-b3ae-6871867c9135|site=ouest-france.fr|date=12 mai 2021}}.</ref>. Elle récupère le {{numéro|3}}. La japonaise joue son premier match officiel avec le club bavarois le {{date-|29|août}} lors de la {{1re|journée}} de [[Championnat d'Allemagne féminin de football 2021-2022|championnat]] contre le [[Werder Brême (féminines)|Werder Brême]] à domicile<ref>{{Lien web|titre=Le FCB prend directement la première place après le 8-0 contre Brême|url=https://fcbayern.com/frauen/de/spiele/frauen/bundesliga/2021-2022/fc-bayern-frauen-sv-werder-bremen-27-08-2021/spielbericht|site=fcbayern.com|date=29 août 2021|langue=allemand}}.</ref> ; elle est titulaire au milieu de terrain et joue l'intégralité de la rencontre remportée {{Abréviation discrète|8-0|Huit buts à zéro}}. Le {{date-|1|octobre}}, elle marque son premier but sur la pelouse du [[1. FC Cologne (féminines)|FC Cologne]] à l'occasion de la {{4e|journée}} de [[Championnat d'Allemagne féminin de football 2021-2022|championnat]]<ref>{{Lien web|titre=Le FCB n'offre aucune chance à Cologne|url=https://www1.wdr.de/sport/fussball/erste-bundesliga/frauen-bl-koeln-bayern-100.html|site=wdr.de|date=1 octobre 2021|langue=allemand}}.</ref> ; à la suite d'un corner mal repoussé par la gardienne Manon Klett, Saki Kumagai réceptionne la balle au second poteau et marque le deuxième but de la rencontre à la {{21e|minute}}.
