Libre de tout contrat, Saki Kumagai s'engage officiellement le {{date-|5|juin|2023}} avec le [[Championnat d'Italie féminin de football|champion d'Italie]] en titre, l'[[Associazione Sportiva Roma (féminines)|AS Roma]]<ref>{{Lien web|titre=Saki Kumagai s’engage avec l’ AS Roma|url=https://www.lequipiere.com/mercato-saki-kumagai-sengage-avec-l-as-roma/|site=lequipiere.com|date=6 juin 2023}}.</ref>. Elle signe un contrat d'une durée de deux saisons jusqu'en 2025<ref>{{Lien web|langue=anglais |titre=Saki Kumagai est une nouvelle joueuse jaune et rouge|url=https://www.asroma.com/en/news/68757/roma-women-saki-kumagai-is-a-new-giallorosse-player|site=asroma.com|date=5 juin 2023}}.</ref> et récupère le {{numéro|8}}.
