Les Nadeshiko démarrent leur [[Coupe d'Asie des nations de football féminin 2018|compétition]] en [[Jordanie]] le {{date-|7|avril}} contre l'[[Équipe du Viêt Nam féminine de football|équipe du Viêtnam]] au King Abdullah II Stadium d'[[Amman]] et s'imposent largement {{Abréviation discrète|4-0|Quatre buts à zéro}}<ref>{{Lien web|titre=Le Vietnam a été battu par le Japon|url=https://fr.vietnamplus.vn/football-feminin-le-vietnam-a-ete-battu-par-le-japon-a-asian-cup-2018/101698.vnp|site=fr.vietnamplus.vn|date=9 avril 2018}}.</ref>. Au deuxième match de poule le {{date-|10|avril}} au [[Stade international d'Amman]], elles affrontent la [[Équipe de Corée du Sud féminine de football|Corée du Sud]], mais les deux formations se séparent sur un match nul logique {{Abréviation discrète|0-0|Zéro but partout}}<ref>{{Lien web|titre=Coupe d'Asie - J2|url=https://www.footofeminin.fr/FIFAWWC-Asie-J2-La-CHINE-decroche-son-billet-pour-la-FRANCE_a14641.html|site=footofeminin.fr|date=11 avril 2018}}.</ref>. Alors qu'aucune équipe n'est encore qualifiée, le {{date-|13|avril}} au [[Stade international d'Amman]], les joueuses d'[[Asako Takakura]] parviennent à mener face à une [[Équipe d'Australie féminine de football|équipe australienne]] pourtant bien regroupée mais [[Sam Kerr]] les oblige à concéder le point du match nul {{Abréviation discrète|1-1|Un but partout}} en fin de partie<ref>{{Lien web|titre=Le Japon et l'Australie en demi-finales|url=http://www.coeursdefoot.fr/event/coupe-d-asie-2018-le-japon-et-l-australie-en-demi-finales-et-qualifies-pour-la-coupe-du-monde-2019/|site=coeursdefoot.fr|date=13 avril 2018}}.</ref> ; les deux équipes se qualifient tout de même pour la phase suivante. Cette qualification est également synonyme d'une participation directe à la prochaine [[Coupe du monde féminine de football 2019|Coupe du monde 2019]] organisée en [[France]]<ref>{{Lien web|titre=C.D.M. 2019 : l'Australie et le Japon qualifiés|url=https://www.lequipe.fr/Football/Actualites/Coupe-du-monde-2019-f-l-australie-et-le-japon-qualifies/892543|site=lequipe.fr|date=13 avril 2018}}.</ref>. En demi-finale le {{date-|17|avril}}, les Japonaises affrontent la [[Équipe de Chine féminine de football|Chine]] au King Abdullah II Stadium et s'imposent {{Abréviation discrète|3-1|Trois buts à un}} tout en maîtrise<ref>{{Lien web|titre=Le Japon de Kumagai en finale de la Coupe d'Asie|url=https://www.olweb.fr/fr/article/selections-le-japon-de-saki-kumagai-en-finale-de-la-coupe-d-asie-34762.html|site=olweb.fr|date=18 avril 2018}}.</ref>.

En finale, les Japonaises sont de nouveau opposées aux Matildas d'[[Équipe d'Australie féminine de football|Australie]] le {{date-|20|avril}} au [[Stade international d'Amman]]. Durant le match, les Japonaises subissent le rythme des australiennes tout au long de la rencontre sans parvenir à les inquiéter ; Saki Kumagai provoque même un penalty après {{nombre|14|minutes}} de jeu sur une faute de main, mais sans conséquence puisque la gardienne nippone stop le tir d'[[Elise Kellond-Knight]]. Il faut attendre la fin de match et l'entrée en jeu de [[Kumi Yokoyama]] pour finalement voir le [[Équipe du Japon féminine de football|Japon]] s'imposer {{Abréviation discrète|1-0|Un but à zéro}} grâce à une frappe imparable dans la lucarne<ref>{{Lien web|titre= Le Japon remporte le titre face à l'Australie|url=http://www.coeursdefoot.fr/event/coupe-d-asie-2018-le-japon-remporte-le-titre-face-a-l-australie-au-terme-d-une-finale-spectaculaire/|site=coeursdefoot.fr|date=20 avril 2018}}.</ref>. Les Nadeshiko remportent leur deuxième sacre continental et conservent leur titre après celui de l'[[Coupe d'Asie des nations de football féminin 2014|édition 2014]]. Saki Kumagai remporte quant à elle sa première [[Coupe d'Asie de football féminin|Coupe d'Asie]] avec l'[[Équipe du Japon féminine de football|équipe A]], en ayant participé à l'intégralité des cinq rencontres en tant que [[Capitaine (sport)|capitaine]]. {{Boîte déroulante/début|titre=Résultats de Saki Kumagai dans la compétition|alignB=centre|align=justify|alignT=right|largeur=70%|couleurFondT=transparent|couleurFondB=transparent|arrondi=0.6em}}

{{Boîte déroulante/fin}}

Fortes de leurs statuts de championnes d'Asie et de vice-championnes du monde, les joueuses nippones entrevoient également la [[Coupe du monde féminine de football 2019|compétition]] comme une phase de préparation importante en vue des [[Jeux olympiques d'été de 2020|Jeux olympiques 2020 de Tokyo]]. Elles jouent leur premier match contre l'[[Équipe d'Argentine féminine de football|Argentine]] le {{date-|10|juin}} au [[Parc des Princes]] à [[Paris]]. Le match s'achève sur un décevant match nul {{Abréviation discrète|0-0|Zéro but partout}}<ref>{{Lien web |titre=Le Japon tenu en échec par l’Argentine au Parc des Princes |url=https://www.ouest-france.fr/sport/coupe-du-monde/direct-coupe-du-monde-feminine-2019-argentine-japon-groupe-d-6390562 |site=ouest-france.fr |date=10 juin 2019}}</ref>.
[[Fichier:FIFA WWC 2019 - Netherlands vs Japan - Rennes 20190625-13.jpg|thumb|alt=Roazhon Park|[[Roazhon Park]] de [[Rennes]] le {{date-|25|juin}} lors du huitième de finale contre les [[Équipe des Pays-Bas féminine de football|Pays-Bas]].|gauche|200x200px]]
Le deuxième match à lieu le {{date-|14|juin}} au [[Roazhon Park]] de [[Rennes]] face à l'[[Équipe d'Écosse féminine de football|Écosse]] ; les Japonaises l'emportent {{Abréviation discrète|2-1|Deux buts à un}} grâce à des buts de [[Mana Iwabuchi]] et [[Yuika Sugasawa]]<ref>{{Lien web |titre=Le Japon tient son rang face à l’Écosse |url=https://www.ouest-france.fr/sport/coupe-du-monde/direct-coupe-du-monde-feminine-2019-suivez-le-match-entre-le-japon-et-l-ecosse-6397777 |site=ouest-france.fr |date=14 juin 2019}}</ref>. Pour le troisième match, le {{date-|19|juin}} à l'[[Allianz Riviera]] de [[Nice]], les joueuses de d'[[Asako Takakura]] font face à une [[Équipe d'Angleterre féminine de football|équipe anglaise]] dominatrice et perdent le match {{Abréviation discrète|2-0|Deux buts à zéro}}<ref>{{Lien web |titre=L'Angleterre domine facilement le Japon |url=https://www.rtl.fr/sport/football/en-direct-coupe-du-monde-feminine-2019-japon-angleterre-en-live-commente-7797883722 |site=rtl.fr |date=19 juin 2019}}</ref>. Elles se qualifient tout de même pour la phase suivante.

En huitième de finale le {{date-|25|juin}}, le [[Équipe du Japon féminine de football|Japon]] affronte les [[Équipe des Pays-Bas féminine de football|Pays-Bas]] au [[Roazhon Park]]. Après avoir touché le poteau après cinq minutes de jeu, les Oranje ouvrent le score par [[Lieke Martens]] qui reprend un corner frappé par [[Daniëlle van de Donk]] à la {{17e|minute}}. Bien que dominées dans le jeu, les Japonaises réagissent aussitôt par l'intermédiaire de [[Yuika Sugasawa]] qui trouve le poteau, puis égalisent deux minutes avant la pause par [[Yui Hasegawa]]. La seconde période est initialement équilibrée, mais voit petit à petit le Japon prendre l'ascendant sur le plan technique et obtenir plus d'occasions franches que des Bataves en proie au doute depuis l'égalisation nippone. À deux minutes de la fin, les Néerlandaises obtiennent finalement un penalty litigieux<ref>{{Lien web |titre=Les Pays-Bas éliminent le Japon après un superbe match et filent en quarts |url=https://www.lequipe.fr/Football/Actualites/Coupe-du-monde-les-pays-bas-eliminent-le-japon-apres-un-superbe-match-et-filent-en-quarts/1033789 |site=lequipe.fr |date=26 juin 2019}}</ref> contre le cours du jeu à la suite d'un ballon dévié du bras par Saki Kumagai à la {{91e|minute}}. Le penalty est transformé par [[Lieke Martens]] et permet aux [[Équipe des Pays-Bas féminine de football|Pays-Bas]] de se qualifier pour les quarts de finale grâce à cette victoire {{Abréviation discrète|2-1|Deux buts à un}}<ref>{{Lien web |titre=Les Pays-Bas se qualifient pour les quarts face au Japon |url=https://www.rtl.fr/sport/football/copie-de-en-direct-coupe-du-monde-feminine-2019-japon-en-live-commente-7797891805 |site=rtl.fr |date=26 juin 2019}}</ref>. Saki Kumagai participe à l'intégralité des quatre rencontres. Dans l'optique des [[Jeux olympiques d'été de 2020|Jeux olympiques]] à domicile, cette désillusion interroge sur les changements à mener dans cette équipe qui peine à intégrer efficacement les jeunes joueuses.
{{Boîte déroulante/début|titre=Résultats de Saki Kumagai dans la compétition|alignB=centre|align=justify|alignT=right|largeur=70%|couleurFondT=transparent|couleurFondB=transparent|arrondi=0.6em}}

{{Boîte déroulante/fin}}

Pays hôte du tournoi, l'[[Équipe du Japon féminine de football|équipe du Japon]] est qualifiée d'office et ne dispute donc pas le [[Tournoi pré-olympique féminin de l'AFC 2020|tournoi pré-olympique de l'AFC]]. La [[pandémie de Covid-19]] a repoussé la tenue des [[Jeux olympiques d'été de 2020|Jeux olympiques]] à l'année [[2021]]. Les Nadeshiko jouent leur premier match contre le [[Équipe du Canada féminine de soccer|Canada]] le {{date-|21|juillet}} au [[Sapporo Dome]], dans la ville natale de Saki Kumagai. Le match s'achève sur un match nul {{Abréviation discrète|1-1|Un but but partout}}<ref>{{Lien web |langue=anglais |titre=Le Japon fait match nul 1-1 face au Canada lors du match d'ouverture |url=https://english.kyodonews.net/news/2021/07/776303c8e468-olympics-japan-draw-1-1-with-canada-in-womens-soccer-opener.html |site=kyodonews.net |date=21 juillet 2021}}</ref>. Le deuxième match se déroule le {{date-|24|juillet}}, toujours à [[Sapporo]], face à la [[Équipe de Grande-Bretagne olympique féminine de football|Grande-Bretagne]] ; les Japonaises sont défaites {{Abréviation discrète|1-0|Un but à zéro}} après un but à la {{74e|minute}} d'[[Ellen White (football)|Ellen White]]<ref>{{Lien web |langue=anglais |titre=JO Tokyo - Score final, résultat et réaction de l'équipe ; La Grande-Bretagne rejoint les quarts |url=https://www.independent.co.uk/sport/olympics/tokyo-2020-gb-japan-football-b1889784.html |site=independent.co.uk |date=25 juillet 2021}}</ref>. Alors que la victoire est impérative pour le troisième match, le {{date-|27|juillet}} au [[Stade de Miyagi|Miyagi Stadium]] de [[Rifu]], les joueuses d'[[Asako Takakura]] font face à une [[Équipe du Chili féminine de football|équipe chilienne]] bien organisée mais réussissent à l'emporter {{Abréviation discrète|1-0|Un but à zéro}}, non sans peur, grâce à un but de [[Mina Tanaka]] à la {{77e|minute}}<ref>{{Lien web |langue=anglais |titre=Le Japon bat le Chili 1-0 et rejoint les quarts de finale |url=https://english.kyodonews.net/news/2021/07/169c5bdb1dcf-olympics-japan-beat-chile-1-0-to-reach-womens-soccer-quarterfinals.html |site=kyodonews.net |date=27 juillet 2021}}</ref>. Elles se qualifient pour la phase suivante grâce à la règle qualifiant les deux meilleures troisième.

En quart de finale le {{date-|30|juillet}}, le [[Équipe du Japon féminine de football|Japon]] affronte la [[Équipe de Suède féminine de football|Suède]] au [[Stade Saitama 2002|Saitama Stadium 2022]]. Les scandinaves ouvrent rapidement le score à la {{7e|minute}} grâce à [[Magdalena Eriksson]]. Malgré l'égalisation de [[Mina Tanaka]] à la {{23e|minute}}, les suédoises ajoutent deux buts supplémentaires en seconde mi-temps et s'adjugent la rencontre {{Abréviation discrète|3-1|Trois buts à un}}<ref>{{Lien web |langue=anglais |titre=Les ambitions japonaises stoppées par la Suède |url=https://english.kyodonews.net/news/2021/07/951a8ee6fdcc-olympics-japans-womens-soccer-ambitions-ended-by-sweden.html |site=kyodonews.net |date=30 juillet 2021}}</ref>. Saki Kumagai, [[Capitaine (sport)|capitaine]] de l'équipe, participe à l'intégralité des quatre matchs en défense centrale. À la suite de ce parcours peu convainquant et de cette élimination prématurée, la sélectionneuse [[Asako Takakura]] est démis de ses fonctions après cinq années à la tête de l'équipe<ref>{{Lien web |langue=anglais |titre=Takakura écartée après la désillusion des Jeux |url=https://www.nippon.com/en/news/reu20210827KBN2FS0X8/ |site=nippon.com |date=27 août 2021}}</ref>. Elle est officiellement remplacée en {{date-||octobre|2021}} par [[Futoshi Ikeda]]<ref>{{Lien web |langue=anglais |titre=Futoshi Ikeda nommé nouveau sélectionneur de l'équipe féminine du Japon |url=https://sportstar.thehindu.com/football/futoshi-ikeda-new-manager-japan-womens-national-team-tokyo-games-takakura/article36787884.ece |site=sportstar.thehindu.com |date=2 octobre 2021}}</ref>, récent vainqueur de la [[Coupe du monde féminine de football des moins de 20 ans 2018|Coupe du monde des moins de 20 ans 2018]] organisée en [[France]].
