Les Japonaises démarrent leur [[Coupe d'Asie féminine de football 2022|compétition]] en [[Inde]] le {{date-|21|janvier}} contre l'[[Équipe de Birmanie féminine de football|équipe de Birmanie]] au Shree Shiv Chhatrapati Sports Complex de [[Pune]] et s'imposent facilement {{Abréviation discrète|5-0|Cinq buts à zéro}}<ref>{{Lien web |langue=anglais |titre=Le Japon entame la défense de son titre par une victoire 5-0 contre la Birmanie |url=https://www.news18.com/news/football/afc-womens-asian-cup-2022-japan-open-title-defence-with-5-0-win-over-myanmar-4683182.html |site=news18.com |date=21 janvier 2022}}.</ref>. Au deuxième match de poule le {{date-|24|janvier}} à [[Pune]], elles dominent le [[Équipe du Viêt Nam féminine de football|Viêt Nam]] {{Abréviation discrète|3-0|Zéro but partout}}<ref>{{Lien web |langue=anglais |titre=Le Viet Nam perd encore en Coupe d'Asie |url=https://e.vnexpress.net/news/football/vietnam-lose-again-in-womens-asian-cup-4420532.html |site=vnexpress.net |date=24 janvier 2022}}.</ref> ; Saki Kumagai inscrit le deuxième but de la rencontre (également le deuxième de sa carrière en sélection A) à la {{50e|minute}} du genou gauche sur un second ballon à la suite d'un [[Loi 13 du football|coup franc]] indirect. Alors que la première place du groupe n'est pas encore assurée, le {{date-|27|janvier}} toujours à [[Pune]], les joueuses de [[Futoshi Ikeda]] parviennent à mener dès la {{1ere|minute}} face à la [[Équipe de Corée du Sud féminine de football|Corée du Sud]] mais elles sont finalement tenues en échec {{Abréviation discrète|1-1|Un but partout}} en fin de partie<ref>{{Lien web |langue=anglais |titre=Le Japon finit premier après sa rencontre avec la Corée du Sud |url=https://www.the-afc.com/en/national/afc_womens_asian_cup/news/report_group_c_japan_v_korea_republic.html |site=the-afc.com |date=27 janvier 2022}}.</ref> ; les deux équipes se qualifient pour la phase suivante et les Nadeshiko finissent premières de leur groupe.

En quarts de finale, elles éliminent aisément la [[Équipe de Thaïlande féminine de football|Thaïlande]] {{Abréviation discrète|7-0|Sept buts à zéro}} le {{date-|30|janvier}} au [[DY Patil Stadium]] de [[Bombay]]. Cette qualification est également synonyme d'une participation directe à la prochaine [[Coupe du monde féminine de football 2023|Coupe du monde 2023]] organisée en [[Australie]] et en [[Nouvelle-Zélande]]<ref>{{Lien web |langue=anglais |titre=Le Japon toujours au top, la désillusion de l'Australie, les Philippines marquent l'histoire |url=https://www.cbssports.com/soccer/news/afc-womens-asian-cup-power-rankings-japan-still-top-of-class-australia-crash-out-philippines-make-history/ |site=cbssports.com |date=1 février 2022}}.</ref>. En demi-finale le {{date-|3|février}}, les Japonaises affrontent la [[Équipe de Chine féminine de football|Chine]] à [[Pune]] et se séparent sur un match nul {{Abréviation discrète|2-2|Deux buts partout}} <ref>{{Lien web |langue=anglais |titre=La Chine élimine le Japon et rejoint la Corée du Sud en finale |url=https://indianexpress.com/article/sports/football/china-stun-japan-in-afc-womens-asian-cup-semifinals-face-korea-in-final-7755701/ |site=indianexpress.com |date=4 février 2022}}.</ref> ; lors de la séance de [[Tirs au but (football)|tir au but]], Saki Kumagai est la première à s'élancer mais rate son tir à ras de terre sur la droite de la gardienne. Le Japon s'incline finalement {{Abréviation discrète|4-3|Quatre tirs au but à trois}}. Les Nadeshiko ne parviennent donc pas à conserver leur titre après celui de l'[[Coupe d'Asie féminine de football 2018|édition 2018]]. Toujours [[Capitaine (sport)|capitaine]] de l'équipe, Saki Kumagai a participé à l'intégralité des cinq rencontres.
