[[Fichier:2023-07-07 Fussball, Frauen, Länderspiel, Deutschland - Sambia 1DX 6938 by Stepro (cropped).jpg|thumb|alt=Ballon de la Coupe du monde 2023|Ballon officiel de la [[Coupe du monde féminine de football 2023|Coupe du monde 2023]].|droite|200px]]
Cette nouvelle [[Coupe du monde féminine de football 2023|Coupe du monde]] voit le nombre d'équipes engagées passer de {{nombre|24|à=32}}. Les Nadeshiko démarrent leur [[Coupe du monde féminine de football 2023|compétition]] en [[Nouvelle-Zélande]] le {{date-|22|juillet}} contre la [[Équipe de Zambie féminine de football|Zambie]] au [[Waikato Stadium]] d'[[Hamilton (Nouvelle-Zélande)|Hamilton]] et s'imposent très largement {{Abréviation discrète|5-0|Quatre buts à zéro}}<ref>{{Lien web|titre=Le Japon surclasse la Zambie minée par les affaires|url=https://www.lequipe.fr/Football/Actualites/Le-japon-surclasse-la-zambie-minee-par-les-affaires/1409595|site=lequipe.fr|date=22 juillet 2023}}.</ref> ; [[Futoshi Ikeda]] met en place une formation à trois défenseures avec Saki Kumagai dans l'axe devant la gardienne. Au deuxième match, elles affrontent le [[Équipe du Costa Rica féminine de football|Costa Rica]] au [[Forsyth Barr Stadium]] de [[Dunedin]] le {{date-|26|juillet}}. Elles gèrent aisément la rencontre et l'emportent {{Abréviation discrète|2-0|Deux buts à zéro}}<ref>{{Lien web|titre=Le Japon bat le Costa Rica sans trembler|url=https://www.lequipe.fr/Football/Actualites/Le-japon-bat-le-costa-rica-sans-trembler/1410200|site=lequipe.fr|date=26 juillet 2023}}.</ref> ; cette victoire est déjà synonyme de qualification pour les huitièmes de finale avant le dernier match de groupe. Ce dernier a lieu le {{date-|31|juillet}} au [[Wellington Regional Stadium|Sky Stadium]] de [[Wellington]] face à [[Équipe d'Espagne féminine de football|La Roja]] ; une opposition de taille que les Japonaises maîtrisent de bout en bout grâce à des contre-attaques efficaces et une grosse densité de joueuses au milieu de terrain. Elles s'adjugent la rencontre {{Abréviation discrète|4-0|Quatre buts à zéro}} et finissent premières de leur groupe<ref>{{Lien web|titre=Le Japon humilie l’Espagne|url=https://www.sofoot.com/breves/le-japon-humilie-lespagne|site=sofoot.com|date=31 juillet 2023}}.</ref>.

En huitième de finale, le {{date-|5|août}} à [[Wellington]], le Japon est confronté à la [[Équipe de Norvège féminine de football|Norvège]] d'[[Ada Hegerberg]] et s'impose logiquement {{Abréviation discrète|3-1|Trois buts à un}}<ref>{{Lien web|titre=Le Japon écarte la Norvège et accède aux quarts|url=https://www.sofoot.com/breves/le-japon-ecarte-la-norvege|site=sofoot.com|date=5 août 2023}}.</ref> ; Malgré l'égalisation de [[Guro Reiten]] à la {{20e|minute}}, Saki Kumagai et ses coéquipières reprennent le jeu à leur compte et inscrivent deux autres buts. En quart de finale à l'[[Eden Park]] d'[[Auckland]] le {{date-|11|août}}, le Japon est dominé par la [[Équipe de Suède féminine de football|Suède]] pendant la majeure partie du match. La défenseuse [[Amanda Ilestedt]] donne l'avantage à son équipe à la {{unité|32e|minute}}, avant que [[Filippa Angeldal]] n'ajoute le deuxième sur penalty juste après la pause. Mais le Japon n'abandonne pas le combat et pousse dans la dernière demi-heure pour revenir dans le match. Mais [[Riko Ueki]] rate un pénalty à la {{unité|76e|minute}} de jeu. La remplaçante [[Honoka Hayashi]] marque pour revenir au score mais cet effort est vain. La Suède tient bon jusqu'à la fin et se qualifie<ref>{{Lien web|auteur=|titre=La Suède élimine le Japon et affrontera l'Espagne en demi-finales de la Coupe du monde|url=https://www.lequipe.fr/Football/Actualites/La-suede-elimine-le-japon-et-affrontera-l-espagne-en-demi-finales-de-la-coupe-du-monde/1413027|date=11 août 2023 |site=lequipe.fr|consulté le=}}.</ref>. Saki Kumagai joue intégralité des cinq rencontres en tant que capitaine.

